import React from 'react';

import {
  Container,
  Header,
  Navbar,
  HeaderTextContainer,
  Main,
  Form,
  ProffysList,
} from './styles';

const Proffys: React.FC = () => (
  <Container>
    <Header>
      <Navbar />
      <HeaderTextContainer />
    </Header>
    <Main>
      <Form />
      <ProffysList />
    </Main>
  </Container>
);

export default Proffys;
